 // Create this CSS file for the component's styles

const HorizontalNav = () => {
  return (
    <nav className="horizontal-nav" id="horizontal-nav">
      <div className="logo">
        <img src="/img/LOGO-modified.png" alt="Logo" />
      </div>
      <div className="brand-name">
        <h3><b>Fusion All</b></h3>
      </div>
      <div className="search-container">
        <input type="text" id="search" placeholder="Search..." />
      </div>
      <button className="profile-btn" id="profile-btn">
        <img src="/img/image-modified.png" alt="Profile" />
      </button>
    </nav>
  );
};

export default HorizontalNav;
